    enum PhoneCallConnectTypes
    {
        NumberDoesntExist = 0,
        SimNotInstalled = 1,
        PhoneOff = 2,
        Connected = 3,
        PlayerOffline = 4,
        InCall = 5,
        BlockedNumber = 6,
        EmergencyCall = 7
            
    }
    public class Phone
    {
        public int Id { get; set; }
        public long IMEI { get; set; }
        public int InstalledSim { get; set; }
        public int BatteryLevel { get; set; }
        public int WallpaperId { get; set; }
        public int ContactCapacity { get; set; }
        public bool PoweredOn { get; set; }
        public bool Muted { get; set; } 
        public bool IsPrimary { get; set; }
        public string Passcode { get; set; }
        public bool PassActive { get; set; }

        [NotMapped]
        public Player InCallWith { get; set; }
        [NotMapped]
        public bool CallConnected { get; set; }
        [NotMapped]
        public bool IsCaller { get; set; }
        [NotMapped]
        public bool MicMuted { get; set; }
        [NotMapped]
        public bool Speakerphone { get; set; }


        public static readonly List<string> PhoneWallpapers = new List<string>()
        {
            {"data:image/jpeg;base64," },
            {"data:image/jpeg;base64," },
            {"data:image/jpeg;base64," }
        };

        public static async Task<Phone> CreateNow()
        {
            Phone phone = new Phone()
            {
                BatteryLevel = 100,
                IMEI = await PhoneManager.GenerateImeiAsync(),
                PoweredOn = true,
                WallpaperId = 2

            };
            await PhoneRepository.AddNew(phone);

            PhoneApp phoneApp = new PhoneApp()
            {
                AppId = 0,
                Installed = true,
                PhoneId = phone.Id,
                Purchased = true,
                Position = "51"
            };

            await PhoneAppRepository.AddNew(phoneApp);

            PhoneApp messagesApp = new PhoneApp()
            {
                AppId = 1,
                Installed = true,
                PhoneId = phone.Id,
                Purchased = true,
                Position = "52"
            };

            await PhoneAppRepository.AddNew(messagesApp);

            PhoneApp settingsApp = new PhoneApp()
            {
                AppId = 2,
                Installed = true,
                PhoneId = phone.Id,
                Purchased = true,
                Position = "44"
            };

            await PhoneAppRepository.AddNew(settingsApp);

            SimCard sim = new SimCard()
            {
                Number = await PhoneManager.GeneratePhoneNumberAsync(),
                Credit = 2000,
                IsBlocked = false
            };

            await SimCardRepository.AddNew(sim);

            phone.InstalledSim = sim.Id;

            PhoneRepository.UpdateAsync(phone);

            return phone;
        }
    }
}
